import React, { Component } from "react";

class App extends Component{
    state={
        isLoading:true
    };

    render(){
        const {isLoading} = this.state;
        return (
        isLoading 
        ? 
        <div className="loader">
            <span className="loader-loading">Loading...</span>
        </div> 
        : "Ready"
        )
    }
}

export default App;
